import React, { Component } from "react";
import { Container, Icon, Menu, Segment } from "semantic-ui-react";
import { Button } from "semantic-ui-react";
import "./Navi.css";

export default function Navi() {
  const mystyle = {
    padding: "10px"
  };
  const navistyle =
  {
    color:"white",
    backgroundColor:"black"
  } 

  return (
    <div>
      <Menu style={{ backgroundColor: "#800080"}} fixed="top" size="large">
          <Container style={mystyle}>
            <Menu.Item name="Anasayfa" style={navistyle}/>
            <Menu.Item name="messages" />
            <Menu.Item name="friends" />
            <Container className="d-flex justify-content-end">
            <Button backgroundcolor = "grey" inverted color='black'> <Icon name='shopping cart' />Sepetim</Button>
            </Container>
          </Container>
        </Menu>
    </div>
  )
}
